import React from 'react';
import { Link } from 'react-router-dom';
import { Stack, Button } from '@mui/material';
import Logo from '../assets/images/Logo.png';

const Navbar = () => (
  <Stack
    direction="row"
    justifyContent="space-between"
    alignItems="center"
    sx={{
      gap: { sm: '123px', xs: '20px' },
      mt: { sm: '32px', xs: '20px' },
      px: '20px',
      py: '10px',
      backgroundColor: '#1a1a1a',
      boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
    }}
  >
    <Link to="/">
      <img
        src={Logo}
        alt="logo"
        style={{ width: '150px', height: '72px', margin: '0px 20px' }}
      />
    </Link>
    <Stack
      direction="row"
      gap={{ sm: '40px', xs: '20px' }}
      fontFamily="Alegreya"
      fontSize={{ sm: '24px', xs: '18px' }}
      alignItems="center"
      sx={{ color: '#e0e0e0' }}
    >
      <Link
        to="/"
        style={{
          textDecoration: 'none',
          color: '#ff2625',
          borderBottom: '3px solid #ff2625',
        }}
      >
        Home
      </Link>
      <a href="#exercises" style={{ textDecoration: 'none', color: '#e0e0e0' }}>
        Exercises
      </a>
      <Link to="/shop" style={{ textDecoration: 'none', color: '#e0e0e0' }}>
        Shop
      </Link>
      <Link to="/about" style={{ textDecoration: 'none', color: '#e0e0e0' }}>
        About Us
      </Link>
      <Button
        component={Link}
        to="/login"
        variant="contained"
        sx={{
          backgroundColor: '#ff2625',
          color: 'white',
          textTransform: 'none',
          borderRadius: '20px',
          padding: { sm: '8px 16px', xs: '6px 12px' },
          fontSize: { sm: '16px', xs: '14px' },
          '&:hover': {
            backgroundColor: '#d22f2f',
          },
        }}
      >
        Login
      </Button>
    </Stack>
  </Stack>
);

export default Navbar;
